JAVA공부 JSON 출력 번역보기 http://blog.naver.com/ghddid13/221134669001
**JSON 출력
=> JSON : 데이터를 자바스크립트 객체 표현법의 문자열로 표시하는 포맷
 기존에 많이 사용하던 XML 보다 용량이 작기 때문에 최근에 많이 사용
=> spring 3.0 버전까지에서는 JSONView 나 ResponseBody 등을 이용해서 출력했지만 4.0버전부터
 는 RestController 를 이용해서 출력이 가능해졌다
=> 요청을 처리하는 클래스 위에 @Controller 대신에 @RestController를 기재하고 요청을 처리하는
 메소드에서 String 을 제외한 데이터 타입으로 리턴하면 알아서 변환해서 출력한다
=> String 을 리턴하는 경우는 문자열을 그대로 출력한다.
=> 문자열을 출력하는 경우는 csv 형식으로 데이터를 리턴하고자 할 때 사용한다.
