package kr.co.ym;
import java.util.List;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.web.bind.annotation.RequestMapping;
import org.springframework.web.bind.annotation.RequestMethod;
import org.springframework.web.bind.annotation.RestController;
import kr.co.y m.domain.Item;
import kr.co.y m.service.ItemService;
@RestController
public class JsonController {
@RequestMapping(value="ite m.csv ", method=RequestMethod.GET)
public String csv()
{
return "Python,Java,C++,C #,Ruby,Scala,Php";
}
@Autowired
private ItemService itemService;
@RequestMapping(value="ite m.json ", method=RequestMethod.GET)
public List<Item> json()
{
return itemService.getList();
}
}
