**HandlerInterceptor
=> Controller 가 요청을 처리하기 전이나 요청을 처리한 후에 호출되는 메소드를 소유한 인터페이스로 JavaEE 에서의 Filter 와 유사한 기능을 수행
=> HandlerInterceptor 인터페이스와 HandlerInterceptorAdapter 추상클래스가 기능을 제공
1. HandlerInterceptor 인터페이스를 implements 한 클래스를 생성하고 코드 작성
- kr.co.y m.interceptor.Loglnterceptor
package kr.co.y m.interceptor;
import java.io.FileOutputStream;
import java.io.PrintWriter;
import java.util.Calendar;
import java.util.Date;
import javax.servlet.http.HttpServletRequest;
import javax.servlet.http.HttpServletResponse;
import org.springframework.stereotype.Component;
import org.springframework.web.servlet.HandlerInterceptor;
import org.springframework.web.servlet.ModelAndView;
import oracle.sql.DATE;
//객체를 자동으로 생성해주는 어노테이션
@Component
public class LogInterceptor implements HandlerInterceptor {
//Controller 에서 요청을 처리하고 난 후 호출되는 메소드
//예외발생 여부에 상관없이 호출
@Override
public void afterCompletion(
HttpServletRequest request,
HttpServletResponse response,
Object object,
Exception exception)
throws Exception {
Syste m.out.println( "요청을 처리했다");
}
//클라이언트의 요청을 처리하고 난 후 호출되는 메소드
//예외가 발생한 경우에는 호출되지 않는다.
@Override
public void postHandle(HttpServletRequest request,
HttpServletResponse response,
Object object,
ModelAndView mav)
throws Exception {
}
//클라이언트의 요청을 처리하기 전에 호출되는 메소드
//true를 리턴하면 controller의 요청 처리 메소드가 호출되고
//false를 리턴하면 controller의 요청 처리 메소드가 호출되지 않는다.
@Override
public boolean preHandle(HttpServletRequest request,
HttpServletResponse response,
Object object) throws Exception {
// 오늘 날짜로 된 텍스트 파일 생성
Calendar cal = Calendar.getInstance();
Date today = new Date(cal.getTimeInMillis());
String filename = today.toString() + ".log";
String logfile = "C:\\Users\\Administrator\\Documents" + filename;
// 위의 파일 경로를 가지고 문자열을 기록할 수 있는 스트림을 생성
FileOutputStream fos = new FileOutputStream(logfile, true);
PrintWriter pw = new PrintWriter(fos);
//클라이언트의 아이피 주소 가져오기
String ip = request.getRemoteAddr();
//클라이언트의 요청 주소 가져오기
String uri = request.getRequestURI();
//파일에 기록
pw.println(ip + "-" + uri + "\n");
pw.flush();
//스트림 닫기
fos.close();
pw.close();
return true;
}
}
